import React from 'react';
import { 
  Container, 
  Typography, 
  Grid, 
  Button, 
  Paper, 
  Box, 
  IconButton,
  useTheme
} from '@mui/material';
import { useNavigate, useLocation, useParams } from 'react-router-dom';
import ArrowBackIcon from '@mui/icons-material/ArrowBack';
import Layout from '../components/Layout';

const servicesByGender = {
  male: [
    { 
      id: 'haircut', 
      name: 'Haircut', 
      description: 'Professional haircut with styling',
      duration: '30 min'
    },
    { 
      id: 'beard', 
      name: 'Beard Trim', 
      description: 'Precision beard trimming and shaping',
      duration: '20 min'
    },
    { 
      id: 'massage', 
      name: 'Head Massage', 
      description: 'Relaxing head and shoulder massage',
      duration: '25 min'
    }
  ],
  female: [
    { 
      id: 'haircut', 
      name: 'Haircut', 
      description: 'Professional haircut with styling',
      duration: '45 min'
    },
    { 
      id: 'facial', 
      name: 'Facial', 
      description: 'Complete facial treatment',
      duration: '60 min'
    },
    { 
      id: 'manicure', 
      name: 'Manicure', 
      description: 'Nail care and hand treatment',
      duration: '45 min'
    }
  ]
};

const Services = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const theme = useTheme();

  // Get gender from location state or default to male
  const gender = location.state?.gender || 'male';
  const color = gender === 'male' ? 'primary' : 'secondary';

  const handleSelect = (service) => {
    navigate('/form', { 
      state: { 
        gender,
        service: service.name,
        serviceDetails: service
      } 
    });
  };

  const handleBack = () => {
    navigate(-1);
  };

  const list = servicesByGender[gender] || [];

  if (!list.length) {
    return (
      <Layout>
        <Container maxWidth="sm" sx={{ textAlign: 'center', mt: 8 }}>
          <Typography variant="h5" color="error">
            No services available for the selected gender.
          </Typography>
          <Button 
            variant="contained" 
            color={color} 
            onClick={handleBack}
            sx={{ mt: 3 }}
          >
            Go Back
          </Button>
        </Container>
      </Layout>
    );
  }

  return (
    <Layout>
      <Container maxWidth="md" sx={{ py: 4 }}>
        <Box sx={{ mb: 4, display: 'flex', alignItems: 'center' }}>
          <IconButton 
            onClick={handleBack} 
            sx={{ mr: 2, color: `${color}.main` }}
          >
            <ArrowBackIcon />
          </IconButton>
          <Typography variant="h4" component="h1" sx={{ 
            fontWeight: 700,
            color: `${color}.main`,
            flexGrow: 1
          }}>
            {gender === 'male' ? "Men's" : "Women's"} Services
          </Typography>
        </Box>

        <Grid container spacing={3}>
          {list.map((service) => (
            <Grid item key={service.id} xs={12} md={6} lg={4}>
              <Paper 
                elevation={2} 
                sx={{ 
                  p: 3, 
                  height: '100%',
                  borderLeft: `4px solid ${theme.palette[color].main}`,
                  transition: 'all 0.3s ease-in-out',
                  '&:hover': {
                    transform: 'translateY(-4px)',
                    boxShadow: 4
                  }
                }}
              >
                <Typography variant="h6" component="h2" sx={{ 
                  color: `${color}.main`,
                  mb: 1 
                }}>
                  {service.name}
                </Typography>
                <Typography variant="body2" color="text.secondary" sx={{ mb: 2 }}>
                  {service.description}
                </Typography>
                <Box sx={{ 
                  display: 'flex', 
                  justifyContent: 'space-between',
                  alignItems: 'center',
                  mt: 'auto',
                  pt: 2
                }}>
                  <Typography variant="body2" color="text.secondary">
                    {service.duration}
                  </Typography>
                  <Button
                    variant="contained"
                    color={color}
                    onClick={() => handleSelect(service)}
                    size="small"
                    sx={{ 
                      borderRadius: 2,
                      textTransform: 'none',
                      fontWeight: 'bold',
                      px: 3,
                      py: 1
                    }}
                  >
                    Book Now
                  </Button>
                </Box>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Layout>
  );
};

export default Services;
